.ep-header, .ep-iFrameContainer, .ep-overlay { display: none; }
.ep-iFrame { border: none; }
.ep-iFrameLarge { height: 500px; overflow: auto; }
.ep-overflow { overflow: unset; }
.ep-overlay { z-index: 10000; position: fixed; inset: 0px; background: rgba(0, 0, 0, 0.5); transition: opacity 0.2s; width: 100%; justify-content: center; align-items: center; }
.ep-wrapper { width: 100%; }
.ep-header { justify-content: flex-end; position: fixed; border-radius: 5px; z-index: 1; }
.ep-close-icon, .ep-minimize-icon { background: rgb(232, 232, 232); width: 23px; height: 23px; margin: 3px 6px 0px 0px; z-index: 999; color: rgb(74, 74, 74); transition: background 0.25s; text-align: center; cursor: pointer; }
.ep-minimize-icon { border-radius: 50%; line-height: 0.3ch; font-size: 22px; border: 1px solid rgb(204, 204, 204); font-family: sans-serif; }
.ep-close-icon { border-radius: 50%; line-height: 1.5ch; font-size: 20px; border: 1px solid rgb(204, 204, 204); font-family: Montserrat; }
.ep-minimize-text-container { height: 100%; text-align: center; }
.ep-minimize-tc-sticky { writing-mode: vertical-lr; justify-content: center; }
.ep-minimize-tc-sticky-left { transform: rotate(360deg); }
.ep-minimize-tc-sticky-right { transform: rotate(180deg); }
.ep-minimize-tc-polite { align-items: end; width: 100%; }
.ep-minimize-tc-polite-left { justify-content: start; }
.ep-minimize-tc-polite-right { justify-content: end; }
.ep-minimize-text { background-color: rgb(0, 0, 0); cursor: pointer; color: rgb(255, 255, 255); white-space: nowrap; overflow: hidden; max-width: 380px; text-overflow: ellipsis; }
.ep-minimize-text-polite { margin-bottom: 8px; }
.ep-minimize-text-polite-left { margin-left: 25px; margin-right: 8px; }
.ep-minimize-text-polite-right { margin-left: 8px; margin-right: 25px; }
.ep-sticky-sidebar { top: 50%; z-index: 9999; position: fixed; }
.ep-height, .ep-sticky-sidebar .ep-wrapper { height: 100%; }
.ep-polite-slide-in { z-index: 9999; position: fixed; }
.ep-inline, .ep-popup { position: relative; margin: auto; }
.ep-polite-slide-in .ep-wrapper { position: absolute; }
.ep-popup { z-index: 9999; }
.ep-inline { overflow: unset; }
.ep-right { right: 15px; }
.ep-left { left: 15px; }
.ep-bottom { bottom: 15px; }
@media only screen and (max-width: 550px) {
  .ep-iFrame, .ep-iFrameContainer { width: 100%; }
  .ep-popup { width: 100% !important; }
  .ep-right { right: 0px; }
  .ep-left { left: 0px; }
  .ep-bottom { bottom: 0px; }
}
.slick-slider { position: relative; display: block; box-sizing: border-box; user-select: none; touch-action: pan-y; -webkit-tap-highlight-color: transparent; }
.slick-list { position: relative; display: block; overflow: hidden; margin: 0px; padding: 0px; }
.slick-list:focus { outline: 0px; }
.slick-list.dragging { cursor: pointer; }
.slick-slider .slick-list, .slick-slider .slick-track { transform: translate3d(0px, 0px, 0px); }
.slick-track { position: relative; top: 0px; left: 0px; display: block; margin-left: auto; margin-right: auto; }
.slick-track::after, .slick-track::before { display: table; content: ""; }
.slick-track::after { clear: both; }
.slick-loading .slick-track { visibility: hidden; }
.slick-slide { display: none; float: left; height: 100%; min-height: 1px; }
[dir="rtl"] .slick-slide { float: right; }
.slick-slide img { display: block; }
.slick-slide.slick-loading img { display: none; }
.slick-slide.dragging img { pointer-events: none; }
.slick-initialized .slick-slide { display: block; }
.slick-loading .slick-slide { visibility: hidden; }
.slick-vertical .slick-slide { display: block; height: auto; border: 1px solid transparent; }
.slick-arrow.slick-hidden { display: none; }
.slick-loading .slick-list { background: url("ajax-loader.gif") center center no-repeat rgb(255, 255, 255); }
@font-face { font-family: slick; font-weight: 400; font-style: normal; src: url("fonts/slick.woff") format("woff"), url("fonts/slick.ttf") format("truetype"); }
.slick-next, .slick-prev { font-size: 0px; line-height: 0; position: absolute; top: 50%; display: block; width: 20px; height: 20px; padding: 0px; transform: translate(0px, -50%); cursor: pointer; color: transparent; border: none; outline: 0px; background: 0px 0px; }
.slick-next:focus, .slick-next:hover, .slick-prev:focus, .slick-prev:hover { color: transparent; outline: 0px; background: 0px 0px; }
.slick-next:focus::before, .slick-next:hover::before, .slick-prev:focus::before, .slick-prev:hover::before { opacity: 1; }
.slick-next.slick-disabled::before, .slick-prev.slick-disabled::before { opacity: 0.25; }
.slick-next::before, .slick-prev::before { font-family: slick; font-size: 20px; line-height: 1; opacity: 0.75; color: rgb(255, 255, 255); -webkit-font-smoothing: antialiased; }
.slick-prev { left: -25px; }
[dir="rtl"] .slick-prev { right: -25px; left: auto; }
.slick-prev::before { content: "←"; }
[dir="rtl"] .slick-prev::before { content: "→"; }
.slick-next { right: -25px; }
[dir="rtl"] .slick-next { right: auto; left: -25px; }
.slick-next::before { content: "→"; }
[dir="rtl"] .slick-next::before { content: "←"; }
